import DialogItem from "./DialogItem";
import s from "./Dialogs.module.css"
import {NavLink} from "react-router-dom";

const DialogMessage = (props) =>{
	return(
		<div className={s.dialogs__message}>
			Hello, how are you?
		</div>
	);
}

const Dialogs = (props) => {
	return (
		<div className={s.dialogs__row}>
			<div className={s.dialogs__items}>
				<DialogItem name="Керим" id="1"/>
				<DialogItem name="Ильяс" id="2"/>
				<DialogItem name="Ибраим" id="3"/>
				<DialogItem name="Ахмад" id="4"/>
				<DialogItem name="Аким" id="5"/>
			</div>
			<div className={s.dialogs__messages}>
				<DialogMessage message="Hello, how are you?"/>
				{/* <div className={s.dialogs__message}>
					Hello, how are you?
				</div> */}
				<div className={s.dialogs__message}>
					Hi, i`m good
				</div>
				<div className={s.dialogs__message}>
					i`m to thanks for your question..
				</div>
			</div>
		</div>
	);
}
export default Dialogs;
